import './ExpenseItem.css';

function ExpenseItem() {
  return (
    <div>
      <div>March 21st 2021</div>
      <div>
        <h2>Car Insurance</h2>
        <div>$100</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
